export const incrementOne = () => {
    return {
        type: 'INCREMENT_ONE'
    }
}

export const incrementHundred = () => {
    return {
        type: 'INCREMENT_HUNDRED'
    }
}

export const decrementOne = () => {
    return {
        type: 'DECREMENT_ONE'
    }
}

export const decrementHundred = () => {
    return {
        type: 'DECREMENT_HUNDRED'
    }
}

export const checkLog = () => {
    return {
